  \"Radiation Hard Multichannel AlN/GaN HEMT for High Efficiency X- and Ka-Band Power
  Amplifiers Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 7,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-06T22:15:37.354992\",\n\t\"name\": \"radiation-hard-multichannel-aln-gan-hemt-for-high-efficiency-x-and-ka-band-power-amplifier\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This project is directed to the development
  of low-loss, high power-density Aluminum Nitride (AlN)/Gallium Nitride (GaN) heterostructure
  based transistors for enabling high-efficiency solid state power amplifiers (SSPA)
  needed for advancing capabilities of future robotic and human exploration spacecraft.
  The AlN/GaN heterostructure is a particularly attractive system for switch-mode
  applications due to the extremely high charge density, high electron mobility, high
  intrinsic breakdown field, and physical thinness achievable and has seen widespread
  investigation toward solid-state amplifiers in the recent years. However, very few
  innovations have been proposed with this heterostructure despite its expansive capacity
  for various creative device concepts. A new patent-pending multichannel AlN/GaN
  Field Screening High Electron Mobility Transistor (FS-HEMT) design is described.
  Preliminary experimental results are presented validating design principles that
  will eliminate current collapse phenomenon at X- and Ka-band frequencies that has
  plagues traditional HEMT designs and will ultimately deliver a low-loss switch-mode
  device.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
